CREATE TABLE `street_correction` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор коррекции',
  `city_object_id` bigint(20) NOT NULL COMMENT 'Идентификатор объекта населенного пункта',
